import React from 'react';

function ProductList({ products, onDelete, onEdit }) {
  if (products.length === 0) return <p>No products added yet.</p>;

  return (
    <table border="1" cellPadding="8">
      <thead>
        <tr>
          <th>#</th>
          <th>Name</th>
          <th>Price</th>
        </tr>
      </thead>
      <tbody>
        {products.map((p) => (
          <tr key={p.id}>
            <td>{p.id}</td>
            <td>{p.name}</td>
            <td>{p.price}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default ProductList;
